import React from "react";

const Services = () => {
  return (
    <React.Fragment>
      <p class="heading">Services</p>
      <p class="sub-heading">Customer Support</p>
      <p class="sub-heading">X-ray equipments</p>
      <ul class="list-group">
        <li class="list-group-item">Installation and calibration of the equipments</li>
        <li class="list-group-item">Periodical maintenance during the warranty period</li>
        <li class="list-group-item">Periodical maintenance on AMCs</li>
        <li class="list-group-item">Services on calls</li>
      </ul>
    </React.Fragment>
  );
};

export default Services;
